import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <Navbar />
      <Home />
      <Rooms />
      <Menu />
      <Contact />
    </div>
  );
}

const Navbar = () => (
  <nav className="navbar">
    <h1>Grand Stay & Dine</h1>
    <ul>
      <li><a href="#home">Home</a></li>
      <li><a href="#rooms">Rooms</a></li>
      <li><a href="#menu">Menu</a></li>
      <li><a href="#contact">Contact</a></li>
    </ul>
  </nav>
);

const Home = () => (
  <section id="home" className="home">
    <h2>Welcome to Grand Stay & Dine</h2>
    <p>Luxury rooms and delicious cuisine under one roof.</p>
    <img src="https://source.unsplash.com/800x400/?hotel,lobby" alt="Hotel Lobby" />
  </section>
);

const Rooms = () => (
  <section id="rooms" className="rooms">
    <h2>Our Rooms</h2>
    <div className="image-grid">
      <img src="https://source.unsplash.com/400x300/?hotel,room" alt="Room 1" />
      <img src="https://source.unsplash.com/400x300/?bedroom,hotel" alt="Room 2" />
      <img src="https://source.unsplash.com/400x300/?hotel,suite" alt="Room 3" />
    </div>
  </section>
);

const Menu = () => (
  <section id="menu" className="menu">
    <h2>Our Food Menu</h2>
    <div className="image-grid">
      <img src="https://source.unsplash.com/400x300/?restaurant,food" alt="Dish 1" />
      <img src="https://source.unsplash.com/400x300/?dessert,restaurant" alt="Dish 2" />
      <img src="https://source.unsplash.com/400x300/?dinner,plate" alt="Dish 3" />
    </div>
  </section>
);

const Contact = () => (
  <section id="contact" className="contact">
    <h2>Contact Us</h2>
    <p>Email: info@grandstay.com</p>
    <p>Phone: +91 12345 67890</p>
    <p>Location: Main Road, City Center</p>
  </section>
);

export default App;
